import React from 'react';

export default function Ad({ ad }) {
  return (
    <div className="card mb-3">
      <div className="card-body">
        <h5 className="card-title">{ad.nazev}</h5>
        <p className="card-text">Cena: {ad.cena} Kƒç</p>
        <p className="card-text">Popis: {ad.popis}</p>
        <p className="card-text">Inzerent: {ad.jmeno} {ad.prijmeni}</p>
        <p className="card-text">Email: {ad.email}</p>
        <div className="d-flex justify-content-between">
          <button className="btn btn-danger" onClick={() => handleDelete(ad.id)}>
            Smazat
          </button>
        </div>
      </div>
    </div>
  );
}
